import React from "react";

const BotCard = ({ image, name, phrase }) => {
  return (
    // display the details in a card
    <div className="card mb-3" style={{maxWpidth:'18rem'}}>
      <img src={image} alt={name} className="card-img-top"/>
      <div></div>
      <h2>{name}</h2>
      <p>{phrase}</p>
    </div>
  );
};

export default BotCard;
